import React, { useState } from 'react'
import "./Header.css"
import logo from "../../assets/logo.png"
import bars from"../../assets/bars.png"
import useWindowSize from '../../hooks/useWindowSize'

function Header() {

    const [isMenuOpned,setIsMenuClicked]=useState(false)

    const [burger_class,setBurgerClass]=useState(undefined)

    let windowSize=useWindowSize()

    // console.log(windowSize[0])

    const handleClick=()=>{
        if(burger_class===undefined)
            setBurgerClass("clicked")
        
         if(burger_class==="clicked")
            setBurgerClass("unclicked")
        
        if(burger_class==="unclicked")
            setBurgerClass("clicked")

        
    }




    return(
    <div className='header'>
        <div className='logo'>
            <img src={logo}/>
        </div>

        {windowSize[0]<=768 &&
          <>  
            <div className='burger-menu' onClick={handleClick}>
                <div className={burger_class} ></div>
                <div className={burger_class} ></div>
                <div className={burger_class} ></div>
            </div>
            <nav className={burger_class}>
                <ul>
                    <li><a href='#Home'>Home</a></li>
                    <li><a href='#Programs'>Programs</a></li>
                    <li><a href='#Why us'>Why us</a></li>
                    <li><a href='#Plans'>Plans</a></li>
                    <li><a href='#Testimonials'>Testimonials</a></li>
                </ul>
            </nav>
            </>
        }
      

      

    </div>
    )
}

export default Header
